1. hardware connection

Module Debugging The download interface is the HST interface. The pinsHST_RX and HST_TX are respectively connected to theTX and RX pins of the USB to serial module (cross connection,HST_RX then TX)

The power can be connected to the lithium battery voltage (ie 3.8v ~ 4.2v) (VBAT pin), can also be connected to 5v power supply (5v input pin or USB input), it should be noted that, if using lithium battery power supply You need to press  POWER KEY  for about 3 seconds to power on the module, USB power will automatically power on the power. In the download or debugging to ensure that has been switched on.


2. Linux

Install dependences

sudo apt install build-essential libqt4-qt3support itcl3 itk3 iwidgets4

Create a link file for serial port as follow, and later you can fill in the coolwatcher's chart with 1,the COM1 must upper-case

sudo ln -s /dev/ttyUSB0 comport/COM1

Then double click coolwatcher to run software

3. Download steps

Update coolwatcher to the latest version(coolwatcher is in the CSDTK folder)

OpenCSDTK/cooltools/coolwatcher.exe or CSDTK/cooltools/coolwatcher in Linux

Select the 8955 for the options on the left, and fill the lastcomport chart with port number of HOST serial (HST) for the connection module. Then click ok




Wait for the connection to succeed, the following screen appears



If there is a connection failure, please refer to [coolwatcher can not connect reason] (#coolwatcher can not connect) part


If first time open coolwatcher, click DRY icon，select the file whose name contains 8955 ramrun spi32m .lod,（onder project platform/ramrun or coolwatcher's cooltools\chipgen\Modem2G\toolpool\plugins\fastpf\flash_programmers folder）。
Only need to set once, will remember later.

Click lod icon, select fimware(.lod) in the hex folder in the GPRS project,  There's two hex file,(`_B.lodand_flash.lod`), you must burn the bigger one to dev board at the first time, then you can just burn the little one to reduce the doanload time. And you must download the bigger if you update the SDK version.

Click download icon to download, then progress bar can be find in the right corner




if burn fail,refer to  coolwatcher Download Fail sectioin.

4. Coolwatcher Connect Fail

Solutions:

Ensure that the serial port and the module are connected (note that the USB port on the development board is not a serial port, and the serial port is connected to the HST_RX andHST_TX pins through the USB to serial port module)

Ensure that the serial port is not occupied by other software

Check the serial number is wrong, set the serial number when restarting, or do not restart click the lower right corner  CoolHost  icon to set 



Then click  connect  to reconnect the serial port
5. Coolwatcher Download Fail


ramrun file error, try using project directory platform / ramrun and coolwatcherCSDTK\cooltools\chipgen\Modem2G\toolpool\plugins\fastpf\flash_programmers directory *_8955_*_spi32m_ramrun.lod

It is possible that the program has entered sleep mode and is reset by the module reset button before downloading

Serial port may be lost, the lower right corner of the taskbar double-click the CoolHost icon to reconnect the serial port, and then download

Serial port other problems, unplug the USB to serial port module re-insert the computer, and then re-connect the serial port

Boot into the program into the sleep mode or thread using the while (1) dead loop and completely take up resources, such as:
